import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import TextGenerator from './projects/projectRNN/TextGenerator.tsx';
import ImageClassifier from './projects/Project3/ImageClassifier.tsx';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1 className="title">AI Hub</h1>
          <p className="subtitle">Explore Neural Networks & Machine Learning</p>
          <nav>
            <ul>
              <li><Link to="/">RNN Text Generator</Link></li>
              <li><Link to="/image-classifier">Image Classifier</Link></li>
            </ul>
          </nav>
        </header>
        <main>
          <Routes>
            <Route path="/" element={<TextGenerator />} />
            <Route path="/text-generator" element={<TextGenerator />} />
            <Route path="/image-classifier" element={<ImageClassifier />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
